import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";

const cardStyle = {
    margin: "8px",
    width: '18rem',
    textColor: "black",
    textAlign: "center"
};

function TruckCard() {
    return (
        <div>
            <Card style={cardStyle}>
                <Card.Img variant="top" src="https://s1.1zoom.ru/big0/187/302174-Berserker.jpg" />
                <Card.Body>
                    <Card.Title>Freightliner Truck</Card.Title>
                    <Card.Text>
                        <span style={{float: 'left'}}>Объём: 16м<sup>3</sup></span>
                        <span style={{float: 'right'}}>Стоимость: 50 000$</span>
                        
                    </Card.Text>
                    <Button variant="primary" style={{alignContent: "center"}}>Посмотреть</Button>
                </Card.Body>
            </Card>
        </div>
    );
}

export default TruckCard;
